import React, {useState} from 'react';

const Delete = () => {
    return (
        <>
            <div className="checkAll">
                <div className="check_password">
                    <h4>방명록을 삭제하시겠습니까?</h4>
                    <button>예</button>
                    <button>아니오</button>
                </div>
            </div>
        </>
    )
}

export default Delete;
